    <script>
        const breadArray = [{
                title: 'Dashboard',
                link: '/',
                active: false
            },
            {
                title: 'Provider',
                link: `{{ theme()->getPageUrl('provider/list') }}`,
                active: false
            },
            {
                title: "{{ ucfirst($providerdetails[0]['name']) }}",
                link: `{{ theme()->getPageUrl('provider/link-provider/'.encryptGdprData($providerdetails[0]['user_id'])) }}`,
                active: false
            },
            {
                title: 'Settings',
                link: '#',
                active: true
            },
        ];
        const breadInstance = new BreadCrumbs(breadArray);
        breadInstance.init();

        const showValidationMessages = (errors) => {
            $.each(errors, function(key, value) {
                var input = $("input[name='" + key + "']");
                var textarea = $("textarea[name='" + key + "']");
                var select = $("select[name='" + key + "']");
                var select2_id = $("#" + key);

                if (key.indexOf(".") != -1) {
                    var arr = key.split(".");
                    input = $("input[name='" + arr[0] + "[]']:eq(" + arr[1] + ")");
                    select = $("input[name='" + arr[0] + "[]']:eq(" + arr[1] + ")"); // simple select
                    textarea = select = $("input[name='" + arr[0] + "[]']:eq(" + arr[1] + ")");
                }

                $(input).next('span.errors').text(value).fadeIn();
                $(input).next('span.form_error').text(value).fadeIn();
                $(input).css('border-color', 'red');

                $(textarea).next('span.errors').text(value).fadeIn();
                $(textarea).next('span.form_error').text(value).fadeIn();
                $(textarea).css('border-color', 'red');

                $(select).next('span.errors').text(value).fadeIn();
                $(select).next('span.form_error').text(value).fadeIn();
                $(select).css('border-color', 'red');

                // if select2
                var error_field = $(select2_id).nextAll('span.form_error').text(value).fadeIn();
                $(error_field).parent().find('.select2-selection').css('border-color', 'red');

                var error_field1 = $(select2_id).nextAll('span.errors').text(value).fadeIn();
                $(error_field1).parent().find('.select2-selection').css('border-color', 'red');
            });
        }

        const removeValidationErrors = () => {
            $("span.errors").text('').hide();
            $("span.form_error").text('').hide();
            $("input").css('border-color', '');
            $("select").css('border-color', '');
            $("textarea").css('border-color', '');
            $(".select2-selection").css('border-color', '');
        }

        $(document).on('click', '#view-provider', function (event) {
            var url = $(this).data('url');
            $('#provider-detail .modal-body').attr('data-kt-indicator', 'on');
            axios.get(url)
                .then(function (response) {
                    setTimeout(function () {
                        $('#provider-detail .modal-body').attr('data-kt-indicator', 'off');
                        $('#provider-detail .modal-body').append(response.data)
                    }, 1000)
                })
                .catch(function (error) {
                    $('#provider-detail .modal-body').attr('data-kt-indicator', 'off');
                    console.log(error);
                })
                .then(function () {

                }); 
        });

        $('#provider-detail').on('hidden.bs.modal', function (e) {
            $('#provider-detail .modal-body').html('<span class="indicator-progress">Please wait... <span class="spinner-border spinner-border-sm align-middle ms-2"></span> </span>');
        });
    </script>

